import React from "react"
import Head from "./Head.js"
import ChooseMenu from "./ChooseMenu.js"
import 'bootstrap/dist/css/bootstrap.min.css';
import "./style.css"
import { Collapse } from "react-bootstrap";


class App extends React.Component {
  constructor(props){
    super(props)
    this.state={
      homemenustart:false,
      homemenu:false,
      wait:""
    }
  }
  sethomemenu(event){
    this.setState({wait:500})
    this.setState({homemenu:event}) 
    this.space(event);
  }
  space(event){
    if(event){
      setTimeout(function() {
        this.setState({homemenustart:event})
      }.bind(this), 100);  
    }    
  }
  render() {
    return (
      <body >
        <div className="APPbackground">
          <Head/>    
          <Collapse  in={this.state.homemenu}>
            <div><ChooseMenu/></div>
          </Collapse>        
          <Collapse  in={!this.state.homemenustart}>
            <card>
            <div className="center APPtexthead APPtexthead2"><div className="APPtexthead1">
                <b>NUMERIC</b>
                </div><br/><div>ระเบิดเวลา ฮ้าาาาาา เริ่มเดินมาตั้งแต่น้องพบเขา
                <br/>เจ้าถ่ายโอนในความเป็นเรา ยกให้เขาทีละน้อย อ้ายวิ่งไขว่คว้าตามใจเจ้าคืน
                <br/>น้องกะบืนหนีใส่เกียร์ถอย ได้แต่มองฮักที่หลุดลอย รอถึงวันเลิกรา</div>
            </div>
            <div className="homemenutop"/>
              <button 
              onClick={()=>this.sethomemenu(!this.state.homemenustart)}
              className="btn btn-lg btn-dark menustartcss" 
              ><b><a href="/ChooseMenu">start</a></b>
            </button>
            <div className="homemenubottom"/>
            </card>
          </Collapse >
        </div>
        <footer className="footer center">
          <div>Made By <a href="https://www.facebook.com/title.tawan" target="_self">Title Tawan.</a></div >
        </footer>
      </body>
    )
  }
}

export default App;
